import styles from "./HomeMain.css"

function Home_Main(mainMovie) {
  return (
    <div className={styles.main}>
      <div>first movie</div>
      <h1> What! </h1>
      <img src="https://image.tmdb.org/t/p/w500//8pjWz2lt29KyVGoq1mXYu6Br7dE.jpg" width="100%" alt="movie" />
    </div>
  )
};

export default Home_Main;
